    footer:'Last updated 3 mins ago'
  },
    {
    name : 'snapchat',
    image: snap,
    description: 'Rejoignez des groupes, exprimez-vous, retrouvez vos amis partout dans le monde sur FB.',
    footer:'Last updated 3 mins ago'
  },
]
handleClik = ()=>{
  this.setState({
      count :this.state.count + 1
  })
  }
  return (
    <div className="App">
     <h1 className="text-center">Popular Socials Medias</h1>
      {
        data.map((element)=>{
          return <Facebook name={element.name} image={element.image} count={element.count}/>
        })
      }
    </div>
  );
}

export default App;
